import React from 'react';
import Practice from './Practice';
import Sdata from './Sdata';

const All = () => {
    return (
        <div>
         { Sdata.map((val) => {
    return(
    <Card 
    key={val.id}
    imgsrc={val.imgsrc} 
    title={val.title} 
    sname={val.sname} 
    link={val.link}
    />
  );
   })}
        </div>

        
    )
}

export default All
